"82209":{"id":"82209","name":"Black Earth Rising","slug":"black-earth-rising","original_title":"Black Earth Rising","overview":"Adotada por uma advogada especialista em direitos humanos após o genocídio de Ruanda, a investigadora Kate Ashby confronta o passado ao assumir casos de crimes de guerra.","first_air_date":"2018-09-10","episode_run_time":60,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Drama Republic","Eight Rooks"],"genres":["Drama","Crime"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/wikVrWQckbFT1ukTAQLPjU3PfAH.jpg","poster_path":"https://image.tmdb.org/t/p/original/77MPYFMYiMi0PFXk1Kr5Nv9yaO7.jpg","cast":["Michaela Coel","John Goodman","Noma Dumezweni","Lucian Msamati","Tyrone Huggins"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/kwUS4mCbDQ1MQ5Br7R8DZD0Qywr.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kwUS4mCbDQ1MQ5Br7R8DZD0Qywr.jpg","air_date":"2018-09-10","episode_count":8,"overview":"N/A","vote_average":7.9,"episodes":{"1":{"name":"Outras notícias","overview":"Kate recebe seu atestado de sanidade mental. O general Simon Nyamoya se entrega à justiça, e a decisão de Eve de assumir o caso abala Kate.","air_date":"2018-09-10","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/1qfxHIRKUtwZItTeslcBUlQCRtN.jpg","vote_average":8},"2":{"name":"Olhando o passado","overview":"Após um crime chocante no Tribunal Penal Internacional, Michael inicia um novo caso. Kate se une a ele na investigação na França.","air_date":"2018-09-17","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/3b8vh97w2ZPe0IL5K43uYkmQvnZ.jpg","vote_average":8},"3":{"name":"Fantasmas","overview":"Em Paris, um homem conta a Kate que o padre Patenaude ainda está vivo. Em Londres, a irmã distante de Eve faz uma visita.","air_date":"2018-09-24","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/IDT4hhQxV46sn28vKf2mQ6ERg9.jpg","vote_average":8},"4":{"name":"Uma tigela de cereal","overview":"Lesage abre o jogo sobre a conspiração. Após Munezero revelar parte do passado de Kate, Michael trabalha no caso de Patrice Ganimana, o arquiteto do genocídio.","air_date":"2018-10-01","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/xrSDXG8aVTXjUHnPxI4rVPG4IR.jpg","vote_average":7},"5":{"name":"Os olhos do diabo","overview":"O passado em comum de Alice e Mundanzi é revelado. Kate recebe um aviso sobre Ganimana, mas pretende assumir o caso apesar das objeções de Michael.","air_date":"2018-10-08","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/yPTyesh52kw9EsGUCxWL4kVpf9u.jpg","vote_average":8},"6":{"name":"A natureza verdadeira do jogo","overview":"Após recuperar o arquivo de Ganimana, Kate viaja para Ruanda com Florence a pedido de Eunice.","air_date":"2018-10-15","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/uUcwaZSKmO9NuVbduZWsQe5UaW8.jpg","vote_average":8},"7":{"name":"A coisa tá feia","overview":"Com o tempo se esgotando, Eunice decide prestar depoimento contra Ganimana e Alice retorna a Ruanda. Michael conta a verdade a Kate.","air_date":"2018-10-22","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/9EERspZSLk00qtBUwJpzFHitKEb.jpg","vote_average":8},"8":{"name":"A Terra que perdoa","overview":"Enquanto Kate viaja para o Congo em busca de covas coletivas, um acontecimento inesperado revela uma grande conspiração internacional.","air_date":"2018-10-29","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/uMc3UTJO3hLeFgmJuJHj9vR8jFn.jpg","vote_average":8}}}}},
